Funciones avanzadas/require.sol.content:
//Especificamos la version
pragma solidity >=0.4.4 <0.7.0;
pragma experimental ABIEncoderV2;

contract Require{

    //Funcion que verifique la contraseña
    function password(string memory _password) public pure returns (string memory) {
        require((keccak256(abi.encodePacked(_password)) == keccak256(abi.encodePacked("123456"))), "Contraseña incorrecta");
        return "Contraseña Correcta";
    }

    //Funcion para pagar

    uint public cartera = 0;
    uint tiempo = 0;
    function pagar(uint _cantidad) public returns(uint){
        require(now> tiempo + 5 seconds,"Aún no puedes pagar");
        tiempo = now;
        cartera+= _cantidad;
    }
}

